import React from 'react';
import logo from "../../images/logo.svg"

const Register = () => {
    return (
        <div className="sign">
            <img src={logo} alt="Логотип"/>
            <h2>Добро пожаловать!</h2>
            <form>
                <p></p>
            </form>
        </div>
    );
};

export default Register;
